import { Component, Input, Output, EventEmitter } from '@angular/core';
import { IconType } from '../icon/icon.component';

type Type = 'primary' | 'secondary' | 'ghost' | 'dashed';
type Size = 'sm' | 'md' | 'lg' | 'xl';
export interface IonButtonProps {
  label?: string;
  type?: Type;
  size?: Size;
  expand?: boolean;
  danger?: boolean;
  disabled?: boolean;
  loading?: boolean;
  loadingMessage?: string;
  iconType?: IconType;
  rightSideIcon?: boolean;
  circularButton?: boolean;
  ionOnClick?: EventEmitter<any>;
}
@Component({
  selector: 'ion-button',
  templateUrl: './button.component.html',
  styleUrls: ['./button.component.scss'],
})
export class ButtonComponent {
  @Input() label?: string;
  @Input() type?: Type = 'primary';
  @Input() size?: Size = 'md';
  @Input() expand? = false;
  @Input() danger? = false;
  @Input() disabled? = false;
  @Input() loading? = false;
  @Input() loadingMessage = 'Carregando...';
  @Input() iconType? = '';
  @Input() rightSideIcon? = false;
  @Input() circularButton? = false;
  @Output() ionOnClick? = new EventEmitter();

  handleClick() {
    if (!this.loading) {
      this.ionOnClick.emit();
    }
  }
}

import { Component, Input } from '@angular/core';

export type Size = 'sm' | 'md';
export interface IonChipProps {
  label: string;
  disabled?: boolean;
  selected?: boolean;
  size?: Size;
}

@Component({
  selector: 'ion-chip',
  templateUrl: './chip.component.html',
  styleUrls: ['./chip.component.scss'],
})
export class ChipComponent {
  @Input('label') label!: string;
  @Input('disabled') disabled? = false;
  @Input('selected') selected? = false;
  @Input('size') size?: Size = 'md';

  select() {
    this.selected = !this.selected;
  }
}

import { Component, Input } from '@angular/core';

export type Orientation = 'horizontal' | 'vertical';

type DividerType = 'solid' | 'dashed' | 'text';

export interface IonDividerProps {
  label?: string;
  orientation?: Orientation;
  type?: DividerType;
}

@Component({
  selector: 'ion-divider',
  templateUrl: './divider.component.html',
  styleUrls: ['./divider.component.scss'],
})
export class IonDividerComponent {
  @Input() label = '';
  @Input() orientation?: Orientation = 'horizontal';
  @Input() type?: DividerType = 'solid';
}

import {
  AfterViewInit,
  Component,
  ElementRef,
  Input,
  ViewChild,
} from '@angular/core';
import { iconsPaths } from './svgs/icons';

export type SvgModule = typeof import('./svgs/icons');
export type IconType = keyof typeof iconsPaths;

export interface IonIconProps {
  type: IconType;
  size?: number;
  color?: string;
}

@Component({
  selector: 'ion-icon',
  templateUrl: './icon.component.html',
  styleUrls: ['./icon.component.scss'],
})
export class IonIconComponent implements AfterViewInit {
  @Input() type: IconType;
  @Input() size = 24;
  @Input() color = '#282b33';

  @ViewChild('svg', { static: false }) svg: ElementRef;

  ngAfterViewInit() {
    this.svg.nativeElement.insertAdjacentHTML(
      'beforeend',
      iconsPaths[this.type]
    );
  }
}

