@import '../../styles/index.scss';

button {
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 10px;
  font-family: 'Source Sans Pro', sans-serif;
  font-weight: 600;
  border-radius: 10px;
  border: 0;
  color: $neutral-1;
  cursor: pointer;
  transition: all 300ms;

  &:focus-visible {
    outline: none;
    box-shadow: 0px 0px 0px 2px $neutral-1, 0px 0px 0px 4px $primary-5;
  }

  &:disabled,
  &:disabled:hover,
  &[disabled],
  &[disabled]:hover {
    background-color: $neutral-3 !important;
    color: $neutral-5 !important;
    cursor: not-allowed;

    &:disabled.spinner {
      border-left-color: $neutral-3;
    }

    ion-icon {
      ::ng-deep svg {
        fill: $neutral-5;
      }
    }
  }

  ion-icon {
    ::ng-deep svg {
      display: flex;
      justify-content: center;
      align-items: center;
      fill: $neutral-1;
    }
  }
}

