  to {
    transform: rotate(360deg);
  }
}

.loading {
  cursor: not-allowed;
  padding: 0 24px;
}

.spinner {
  border: 2px solid transparent;
  border-left-color: $primary-6;
  border-radius: 50%;
  width: 16px;
  height: 16px;
  animation: spin 1s linear infinite;
  margin-right: 10px;
}

.danger {
  span.spinner {
    border-left-color: $negative-6;
  }

  &:hover {
    span.spinner {
      border-left-color: $negative-5;
    }
  }
