.ion-btn-primary {
  background-color: $primary-6;

  &:hover {
    background: $primary-5;
  }

  &.danger {
    background-color: $negative-6;

    &:hover {
      background-color: $negative-5;
      color: $neutral-1;
    }

    span.spinner {
      border-left-color: $neutral-1;
    }
  }

  span.spinner {
    border-left-color: $neutral-1;
  }
}

.ion-btn-secondary {
  background-color: $neutral-1;
  border: 1px solid $neutral-4;
  color: $primary-6;

  &:hover {
    background-color: $primary-1;
    border: 1px solid $primary-4;
    color: $primary-5;

    &:disabled {
      background-color: $neutral-3;
      border: 1px solid $neutral-5;
      color: $neutral-5;
    }
  }

  &.danger {
    color: $negative-color;
  }

  &.danger:hover {
    background-color: $negative-1;
    border: 1px solid $negative-3;
    color: $negative-5;
  }
}

.ion-btn-ghost {
  background-color: transparent;
  color: $primary-6;

  &:disabled {
    background-color: transparent !important;
    color: $neutral-5;
  }

  &:hover {
    background-color: $primary-1;
    color: $primary-5;

    &:disabled {
      background-color: transparent !important;
    }
  }

  &.danger {
    color: $negative-6;

    &:hover {
      background-color: $negative-1;
      color: $negative-5;
    }
  }
}

.ion-btn-dashed {
  background-color: transparent;
  color: $primary-6;
  border: 1px $neutral-4;
  border-style: dashed;

  &:hover {
    background-color: $primary-1;
    color: $primary-5;
    border: 1px $primary-4;
    border-style: dashed;

    &:disabled {
      background-color: $neutral-3;
      border: 1px dashed $neutral-5;
      color: $neutral-5;
    }
  }

  &.danger {
    border: 1px dashed $neutral-4;
    color: $negative-6;

    &:hover {
      background: $negative-1;
      border: 1px dashed $negative-3;
      color: $negative-5;
    }
  }
}

.ion-btn-secondary,
.ion-btn-ghost,
.ion-btn-dashed {
  ion-icon {
    ::ng-deep svg {
      fill: $primary-6;
    }
  }

  &:hover {
    ion-icon {
      ::ng-deep svg {
        fill: $primary-5;
      }
    }
  }

  &.danger {
    ion-icon {
      ::ng-deep svg {
        fill: $negative-color;
      }
    }
  }

  &.danger:hover {
    ion-icon {
      ::ng-deep svg {
        fill: $negative-5;
      }
    }
  }
}

.right-side-icon {
  flex-direction: row-reverse;
}

.ion-remove-space {
  padding: 0 !important;
}

